import React from 'react';
import ReactDom from 'react-dom';
import './style.css';

function BookList() {
  return (
    <section className='booklist'>
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
    </section>
  );
}

const Book = () => {
  return (
    <article className='book'>
      <Image />
      <Title />
      <Author />
    </article>
  );
};
const Image = () => (
  <img src='https://m.media-amazon.com/images/I/91Bd7P8UwxL.jpg' alt='' />
);

const Title = () => <h1>Project Hail Mary</h1>;
const Author = () => (
  <h4 style={{color: '#617d98', fontsize: '0.75rem'}}>ANDY WEIR</h4>
);

ReactDom.render(<BookList />, document.getElementById('root'));
